import React, { Component } from 'react'
import cardImg from '../images/maincard.png';
import path from '../images/Path 14.png';
import Navbar from './Navbar';
export default class MainCard extends Component {
    render() {
        return (
            <div class="card pmd-card  text-white text-center overlay-card">
                <div class="main-card" style={{ height: '100vh' }}>
                    <img src={path}  width='100%' />
                    <img src={cardImg} class="pmd-card-media" height="630px" width='100%' style={{}}/>
                </div>
                <div class="card-img-overlay mt-0 pt-0">
                        <Navbar />
                </div>
            </div>
                
        )
    }
}
